<script>
  import { extent } from "d3-array";
  import { scaleLinear, scaleLog } from "d3-scale";
  import { line, curveBasis, area } from "d3-shape";
  import { currentDataPoint } from "../store.js";
  import { onMount } from "svelte";

  const COLOR_POSITIVE = "#FFB300";
  const COLOR_NEGATIVE = "#38B3F5";

  let consumption = -100;
  //   let data = []
  let tweens = [];
  currentDataPoint.subscribe(newValue => {
    if (newValue) {
      if (newValue.consumption_filled !== null) {
        if (Math.round(newValue.consumption_filled) != consumption) {
          consumption = Math.round(newValue.consumption_filled);
          console.log(consumption);
          markers.forEach(mark => {
            let markerId = "#marker" + mark;
            let markerIdN = "#markerN" + mark;
            gsap.set(markerId, {
              scale: 1 + Math.abs(consumption) / 100
            });
            gsap.set(markerIdN, {
              scale: 1 + Math.abs(consumption) / 100
            });
          });
        }
        console.log(consumption);
      } else {
        // consumption = "ERR";
      }
    }
  });

  let firstRoundEnded = [
    false,
    false,
    false,
    false,
    false,
    false,
    false,
    false,
    false,
    false
  ];

  // the scales
  const yScale = scaleLinear()
    .domain([-100, 100])
    .range([-2, 2]);

  const yTicks = [100, 75, 50, 25, 0, -25, -50, -75, -100];
  const yTexts = [100, 50, 0, -50, -100];
  const margins = { top: 20, right: 20, bottom: 40, left: 25 };

  let vis = false;
  setTimeout(() => (vis = true), 500);
  let vis2 = false;
  setTimeout(() => (vis2 = true), 2 * 500);
  let vis3 = false;
  setTimeout(() => (vis3 = true), 3 * 500);
  let vis4 = false;
  setTimeout(() => (vis4 = true), 4 * 500);
  const NUMBER_MARKERS = 16;

  const markers = [...Array(NUMBER_MARKERS).keys()];
  const DURATION = 3;
  onMount(() => {
    markers.forEach(mark => {
      let markerId = "#marker" + mark;
      let markerIdN = "#markerN" + mark;
      Percent: -50;

      gsap.set(".legend100", {
        transformOrigin: "center",
        rotate: "180",
        scale: 1 + Math.abs(100) / 100
      });

      gsap.set(".legend50", {
        transformOrigin: "center",
        rotate: "180",
        scale: 1 + Math.abs(50) / 100
      });

      gsap.set(".legend1", {
        transformOrigin: "center",
        rotate: "180",
        scale: 1 + Math.abs(1) / 100
      });
      gsap.set(markerId, {
        transformOrigin: "center",
        rotate: "180",
        scale: 1 + Math.abs(consumption) / 100
      });

      gsap.set(markerIdN, {
        transformOrigin: "center",
        scale: 1 + Math.abs(consumption) / 100
      });
      const tl = gsap.timeline({
        repeat: -1,
        delay:
          1.5 * (DURATION - (mark - (mark % 2)) / (markers.length / DURATION))
      });
      tl.from(markerId, {
        y: 0,
        x: 115,
        ease: "none",
        // runBackwards: true,
        duration: DURATION
      });
      if (mark % 2) {
        tl.to(markerId, {
          rotation: 90,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
        tl.to(markerId, {
          y: 35,
          x: 0,
          ease: "none",
          // runBackwards: true,
          duration: DURATION / 2
        });
      } else {
        tl.to(markerId, {
          rotation: -90,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
        tl.to(markerId, {
          y: -35,
          x: 0,
          ease: "none",
          // runBackwards: true,
          duration: DURATION / 2
        });
      }

      const tlN = gsap.timeline({
        repeat: -1,
        delay:
          1.5 * (DURATION - (mark - (mark % 2)) / (markers.length / DURATION))
      });

      if (mark % 2) {
        tlN.to(markerIdN, {
          rotation: -90,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
        tlN.from(markerIdN, {
          y: 35,
          x: 0,
          ease: "none",
          // runBackwards: true,
          duration: DURATION / 2
        });
        tlN.to(markerIdN, {
          rotation: 0,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
      } else {
        tlN.to(markerIdN, {
          rotation: 90,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
        tlN.from(markerIdN, {
          y: -35,
          x: 0,
          ease: "none",
          // runBackwards: true,
          duration: DURATION / 2
        });
        tlN.to(markerIdN, {
          rotation: 0,
          ease: "none",
          // runBackwards: true,
          duration: 0
        });
      }
      tlN.to(markerIdN, {
        y: 0,
        x: 115,
        ease: "none",
        // runBackwards: true,
        duration: DURATION
      });
    });
  });

  const scales = [1, 2, 3, 4, 5];
</script>

